function stringCount(n: number): number {
    const mod = 1e9 + 7;
    const factorial = (x: number): number => {
        let result = 1;
        for (let i = 2; i <= x; i++) {
            result = (result * i) % mod;
        }
        return result;
    };

    if (n < 4) return 0;
    let total = 1;
    for (let i = 1; i <= n; i++) total = (total * 26) % mod;

    if (n === 4) return 12;

    let subtract = (factorial(n - 4) * 24) % mod; // 24 arrangements for "leet"
    for (let i = 1; i <= n - 4; i++) {
        subtract = (subtract * 25) % mod; // For each position not occupied by "leet", choose from 25 letters
    }

    total = (total - subtract + mod) % mod;
    return total;
};
